// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./IERC20.sol";
import "./Ownable.sol";

interface IMonkeys {
    function mintMonkey(
        address to,
        string memory monkeyName,
        uint8 rarity,
        uint8 powerType,
        uint256 attack,
        uint256 health
    ) external returns (uint256);
}

contract MonkeyGacha is Ownable {
    // Constants for rarity chances (in basis points, 10000 = 100%)
    uint16 constant LEGENDARY_CHANCE = 500;  // 5%
    uint16 constant EPIC_CHANCE = 1500;      // 15%
    uint16 constant RARE_CHANCE = 2500;      // 25%
    // Common is the remainder (55%)
    
    // Price for one draw (in tokens)
    uint256 public drawPrice;
    
    // Reference to the token used for purchases
    IERC20 public paymentToken;
    
    // Reference to the Monkeys NFT contract
    IMonkeys public monkeysContract;
    
    // Random nonce for generating random numbers
    uint256 private nonce;
    
    // Events
    event MonkeyDrawn(address indexed player, uint256 indexed tokenId, uint8 rarity);
    event DrawPriceUpdated(uint256 newPrice);
    
    constructor(
        address _monkeysContract,
        address _paymentToken,
        uint256 _drawPrice
    ) {
        monkeysContract = IMonkeys(_monkeysContract);
        paymentToken = IERC20(_paymentToken);
        drawPrice = _drawPrice;
    }
    
    // Function to draw a monkey
    function drawMonkey() external returns (uint256) {
        // Check if player has enough tokens and transfer them
        require(paymentToken.balanceOf(msg.sender) >= drawPrice, "Insufficient tokens");
        require(paymentToken.transferFrom(msg.sender, address(this), drawPrice), "Transfer failed");
        
        // Generate random values for monkey attributes
        uint8 rarity = _generateRarity();
        uint8 powerType = _generatePowerType();
        uint256 attack = _generateStat(rarity);
        uint256 health = _generateStat(rarity);
        
        // Generate a simple name based on rarity
        string memory name = string(abi.encodePacked(
            _getRarityString(rarity),
            " Monkey #",
            toString(nonce)
        ));
        
        // Mint the monkey NFT
        uint256 tokenId = monkeysContract.mintMonkey(
            msg.sender,
            name,
            rarity,
            powerType,
            attack,
            health
        );
        
        emit MonkeyDrawn(msg.sender, tokenId, rarity);
        nonce++;
        
        return tokenId;
    }
    
    // Internal function to generate rarity based on chances
    function _generateRarity() internal view returns (uint8) {
        uint256 rand = _random(10000); // Random number between 0 and 9999
        
        if (rand < LEGENDARY_CHANCE) return 3; // Legendary
        if (rand < LEGENDARY_CHANCE + EPIC_CHANCE) return 2; // Epic
        if (rand < LEGENDARY_CHANCE + EPIC_CHANCE + RARE_CHANCE) return 1; // Rare
        return 0; // Common
    }
    
    // Internal function to generate power type (Fire = 0, Water = 1, Earth = 2)
    function _generatePowerType() internal view returns (uint8) {
        return uint8(_random(3));
    }
    
    // Internal function to generate attack/health stats based on rarity
    function _generateStat(uint8 rarity) internal view returns (uint256) {
        // Base stats range from 50-100
        uint256 base = 50 + _random(51);
        
        // Multiply based on rarity (Common: x1, Rare: x1.2, Epic: x1.5, Legendary: x2)
        uint256[] memory multipliers = new uint256[](4);
        multipliers[0] = 100;  // Common: 100%
        multipliers[1] = 120;  // Rare: 120%
        multipliers[2] = 150;  // Epic: 150%
        multipliers[3] = 200;  // Legendary: 200%
        
        return (base * multipliers[rarity]) / 100;
    }
    
    // Internal function to generate pseudo-random numbers
    function _random(uint256 max) internal view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(
            block.timestamp,
            block.prevrandao,
            msg.sender,
            nonce
        ))) % max;
    }
    
    // Internal function to get rarity string
    function _getRarityString(uint8 rarity) internal pure returns (string memory) {
        if (rarity == 3) return "Legendary";
        if (rarity == 2) return "Epic";
        if (rarity == 1) return "Rare";
        return "Common";
    }
    
    // Admin function to update draw price
    function setDrawPrice(uint256 _newPrice) external onlyOwner {
        drawPrice = _newPrice;
        emit DrawPriceUpdated(_newPrice);
    }
    
    // Admin function to withdraw tokens
    function withdrawTokens(address to) external onlyOwner {
        uint256 balance = paymentToken.balanceOf(address(this));
        require(paymentToken.transfer(to, balance), "Transfer failed");
    }
    
    // Utility function to convert uint to string
    function toString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}

